import React from 'react';

const Card = ({ card }) => {
  return (
    <div className="card" data-card-id={card.cardId}>
      <div className="card-image-container">
        <img src={card.imageUrl} alt={card.cardName} onError={(e) => e.target.src = 'https://i.ibb.co/zSxJyz5/imagenotfound.png'} />
      </div>
      <p>Card ID: {card.cardId}</p>
      <p>Print: {card.print}</p>
      <p>Edition: {card.edition}</p>
      <p>Series: {card.series}</p>
      <p>Name: {card.cardName}</p>
    </div>
  );
};

export default Card;
